import React from "react";
import {connect} from "react-redux";
import {TasksList} from "./TasksList";
import {deleteTaskThunk} from "../../store/createTaskReducer";

const TaskCreateInputContainer = ({tasks,deleteTaskThunk}) => {
    const id = Object.entries(tasks).map(task => task[0])
    const task = Object.entries(tasks).map(task => task[1])

    return (
        <div>
            <TasksList tasks={task}
                       deleteTaskThunk = {deleteTaskThunk}
                       id = {id}
            />
        </div>
    )
};

export default connect(null,{deleteTaskThunk})(TaskCreateInputContainer)
